@CairoFoster joins Matt Barr on the @WeLookSideways Podcast to chat about his history of riding for REAL Skateboards, the Actions REALized reissue of his classic Hammerheads board by @ToddFrancisArt hitting shops soon and why he wanted the proceeds to go to @TheBenRaemersFoundation. Link in our bio. 

(A warning for listeners, the topics of mental health and suicide are discussed in this episode)

